// Space Complexity: O(1)

function factorial(num) {
  let total = 1;
  for (let i = num; i > 1; i--) {
    total *= i;
  }
  return total;
}

// Solution #2
// Time Complexity: O(n)
// Space Complexity: O(n)

function factorial(num) {
  if (num === 0) {
    return 1;
  }
  return num * factorial(num - 1);
}

